(1328, 'SPGS47244', 'UDEFIAGBON OMOGIADE ERNEST', '14184434', 'JUNE 1993', 'SSCE', 'English Language|B3', 'Mathematics|B3', 'Biology|B2', 'Chemistry|B2', 'Physics|C4', 'Geography|B3', 'Economics|B3', 'Agricultural Science|A1', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS47244olevel1.jpg', '', 'UDEFIAGBON OMOGIADE ERNEST', 'MBBS', 'MED9301057', 'UNCLASSIFIED', 'UNIBEN', '6 Years', 'Medicine and Surgery', 'UDEFIAGBON OMOGIADE ERNEST', 'FWACS', '', '', 'West African College of Surgeons', '6 Years', 'Paediatric Surgery', 'SPGS47244cert1.jpg', 'SPGS47244cert2.jpg', '2003/2004', 'KW/UBH/03/849067', 'SPGS47244nysc.jpg', '', '2024-01-19'),
(1329, 'SPGS52061', 'FATAI WASIU ABIODUN', '4303018071', 'JUNE 2004', 'WAEC', 'English Language|C4', 'Mathematics|B3', 'Biology|C4', 'Chemistry|C6', 'Physics|C4', 'Economics|C6', 'Agricultural Science|B3', '|', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS52061olevel1.jpg', '', 'FATAI WASIU ABIODUN', 'B.Sc', 'MRH/2011/041', 'Upper Credit', 'OBAFEMI AWOLOWO UNIVERSITY ILE-IFE', '5years', 'BACHELOR OF MEDICAL REHAB( PHYSIOTHERAPY)', '', '', '', '', '', '', '', 'SPGS52061cert1.jpg', '', '2018', 'A 004051412', 'SPGS52061nysc.jpg', 'I am Fatai Wasiu Abiodun, a compassionate, motivated MRTB registered physiotherapist, am also registered member of HCPC. I graduated in 2017 at Obafemi Awolowo University Ile-Ife. I have had more than 6years clinical and non-clinical work experience.. As a drive for learning progression, improvement and to strengthening pillars of practice, I size opportunity of this MSc program as strategy to achieved self directed development goals.\r\nA lot of researches, literatures have shown the extent of effectiveness of exercises in area of medicine as management/prevention of several musculoskeletal, Neuromuscular, respiratory, cardiopulmonary conditions. My interest in this MSc program stem from fact that exercises has become long term treatment approaches in area of medicine and sport. Hence this will widen my knowledge skills and subsequently impact positively in my practice.', '2024-01-21'),
(1331, 'SPGS39991', 'ARIJENIWA FOLUKE VICTORIA', '4291501018', '2010', 'WAEC', 'English Language|C5', 'Mathematics|C4', 'Biology|C5', 'Chemistry|B3', 'Physics|C5', 'Economics|B3', 'Agricultural Science|C5', 'Geography|C4', 'Yoruba Language|C5', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS39991olevel1.jpg', '', 'ARIJENIWA FOLUKE VICTORIA', 'B.Sc', '1202110', 'First Class', 'Ekiti State University, Ado Ekiti', '4 Years', 'Biochemistry', '', '', '', '', '', '', '', 'SPGS39991cert1.jpg', '', '2019', 'A004024179', 'SPGS39991nysc.jpg', 'In achieving the Sustainable Development Goals which is less than a decade from now, chemical and waste management are of great relevance. I believe that requisite skills and knowledge in toxicology would contribute significantly in preventing complex risks to global health and ecosystems. I have been involved in researches and field work that focuses on how anthropogenic activities negatively impact the environment. In addition, I am a Health Safety Officer with professional certificates in Health Safety and Environment; Level 1, 2, 3 and Environmental Impact Assessment. ', '2024-01-24'),
