(818, 'SPGS21338', 'Omoregie Temidayo Deborah', '60052815ED', '2016', 'National Examinations Council(NECO)', 'English Language|C5', 'Mathematics|C5', 'Biology|C4', 'Chemistry|C5', 'Physics|C5', '|', '|', '|', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS21338olevel1.jpg', '', 'Omoregie Temidayo Deborah', 'B.Sc.', 'AUL/SCI/16/00059', 'First class ', 'AUL', '4 years', 'Microbiology ', '', '', '', '', '', '', '', 'SPGS21338cert1.jpg', '', '2021', 'NYSC/AN/AUL/2021/013602', 'SPGS21338nysc.jpg', '', '2022-09-21'),
(819, 'SPGS17893', 'Bajimi Esther Oluwatosin ', '4290638034', 'June 2014', 'The West African Examination Council ', 'English Language|C4', 'Mathematics|C4', 'Biology|B3', 'Chemistry|C4', 'Physics|C4', 'Agricultural Science|B2', 'Economics|C5', 'Civic Education|B3', 'Geography|A1', 'Bajimi Esther Oluwatosin ', '40230975AE', 'June 2014', 'National Examination Council ', 'English Language|C5', 'Mathematics|C6', 'Biology|C5', 'Chemistry|C5', 'Physics|C6', 'Agricultural Science|C4', 'Economics|C4', 'Civic Education|C6', '|', 'SPGS17893olevel1.jpg', 'SPGS17893olevel2.jpg', 'Bajimi Esther Oluwatosin ', 'B.Sc', 'BMS/15/16/0217', 'Second Class (Honours) Lower Division ', 'Olabisi Onabanjo University ', '4 years', 'Anatomy ', '', '', '', '', '', '', '', 'SPGS17893cert1.jpg', '', '2020', 'OY/OUA/2020/056217', 'SPGS17893nysc.jpg', 'STATEMENT OF INTENT FOR MASTERâ€™S IN PUBLIC HEALTH (MPH)\r\nTo Whom It May Concern:\r\nI am writing to apply for masterâ€™s degree program in Public Health for the 2022/2023 Academic session at the University of Medical Sciences. I have submitted my application with the necessary applicable documents.\r\nI currently hold a Bachelorâ€™s of Science in Anatomy from Olabisi Onabanjo University, where I obtained a Second Class (Hons) Lower degree.\r\nI grew up in the northern part of Nigeria. The health system there is not a balanced one. While growing up in that region, there was so much health advocacy to prevent Female Genital Mutilation (FGM) and girl-child marriage. I was quite young, and did not understand much but I remember the documentaries on the television were focused on the health hazards these young girls were exposed to. It ranged from Vesico-Vaginal Fistula (VVF), anemia, eclampsia, shock, tissue damage, abscesses and even death. They were also discriminated against by family and friends due to these health conditions and could not further their education. \r\nAs the year passed by and I alongside my family relocated to the South-west, I realized I had passion for the health of people around me. With so much encouragement and advice from family and friends, I put in for Medicine and Surgery in the university but was offered Anatomy. Over the course of my undergraduate years and relationship with medical practitioners, I got to know that there is more to health than Medicine and Surgery and so I made up my mind to further my education in a relatable heath field. \r\nDuring my first degree, I took an interest in a compulsory course from the Faculty of Community Medicine and Primary Care. This course brought back my childhood memories of those documentaries on television. In this course, I was exposed to the nationâ€™s statistical analysis on mother and infant mortality rate in the country over the years, the healthcare system in the country which does not correspond to the nationâ€™s population, and economy. I got to know that Female Genital Mutilation (FGM) and girl-child marriage is still practiced especially in remote areas of the country. My knowledge on the Sustainable Development Goals for Nigeria was broadened entirely and I had my first introduction into Public Health.\r\nAfter graduating, I did personal research on public health. I am certain that the study of disease, and population health  that focuses on family and reproductive health in diverse groups are the reasons I want to pursue a Masters in Public Health focusing on Population, Family and Reproductive Health. \r\nI believe to address the health of the nation; you have to address the health of the family.  I have the intellect, skills and talent required to pursue this program, and my desire is to contribute to the advancement of public health care, and to work and share my knowledge with an institution or organization that promotes Family and the Reproductive health of the nationâ€™s population.\r\nIf you have any further questions, please contact me using the information at the top right corner of this letter. Thank you for your time and consideration.\r\n\r\nYours sincerely,\r\nBAJIMI ESTHER OLUWATOSIN\r\n', '2022-09-21'),
