(941, 'SPGS14018', 'OSASONA TITILAYO REBECCA ', '21117826DF', 'MAY/JUNE 2003', 'NECO (SSCE)', 'English Language|C4', 'Mathematics|C5', 'Biology|B2', 'Chemistry|C4', 'Physics|C5', 'Yoruba Language|B2', 'Economics|B2', 'Agricultural Science|B2', 'Geography|B2', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'olevel1.jpg', '', 'OSASONA TITILAYO O. R.', 'BCHD', 'DEN/2003/052', 'PASS', 'OBAFEMI AWOLOWO UNIVERSITY', '6 YEARS', 'DENTISTRY', '', '', '', '', '', '', '', 'cert1.jpg', '', '2013', 'ED/IF/2013/056016', 'nysc.jpg', '', '2022-10-28'),
(945, 'SPGS18526', 'AKINKUNMI FRANCIS', '18212034', 'DECEMBER 1990', 'West African Examination Council', 'English Language|C6', 'Mathematics|B3', 'Biology|B3', 'Chemistry|B3', 'Physics|B2', 'Geography|B2', 'Economics|B2', 'Agricultural Science|B2', 'Yoruba Language|B3', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS18524olevel1.jpg', '', 'AKINKUNMI BOLA FRANCIS', 'M.B.Ch.B', '911410', 'Pass', 'OAU', '6 years', 'Medicine and surgery', '', '', '', '', '', '', '', 'SPGS18524cert1.jpg', '', '2001/2002', 'KT/IFH/99/215009', 'SPGS18524nysc.jpg', '1 have the fellowship of the West African College of Physicians in November 2015. I completed a POST GRADUATE PROGRAM IN PEDIATRIC NUTRITION from Boston University School of Medicine In 2016. I also completed the course Clinical Management of HIV in June  2017 and  Introduction to Epidemiology for Global Health in April 2018 from the UNIVERSITY OF WASHINGTON USA.', '2022-10-29'),
(949, 'SPGS22513', 'Sunday Temitan Hannah ', '30141587JE', '27 June 2013', 'Neco ', 'English Language|C6', 'Mathematics|C6', 'Biology|C6', 'Chemistry|C6', 'Physics|', '|', '|', '|', '|', '', '', '', '', 'Physics|C6', 'Yoruba Language|C5', 'Geography|C6', 'Economics|C5', '|', '|', '|', '|', '|', 'SPGS22513olevel1.jpg', '', 'Sunday Temitan Hannah ', 'B.Sc', 'FUNAI/BSc/015/1301', 'Second class lower', 'Alex ekwueme federal university ndufu alike funai', '4 years', 'Biochemistry (medical)', '', '', '', '', '', '', '', 'SPGS22513cert1.jpg', '', '2019', 'DT/FUN/2019/305402', 'SPGS22513nysc.jpg', 'I amÂ an open mindedÂ person andÂ I am alwaysÂ motivated to work and to learn, am happy and keen to learn everythingÂ I need to be successful in my career and in all aspects of life.\r\nhowever, after reading through the university of medical sciences ilaje websiteÂ IÂ develop an interest to be part of this great citadel ofÂ research and professionalism.\r\nuniversity of medical sciencesÂ holds an outstanding research accomplishments, itÂ is knownÂ for innovative andÂ world class researchÂ reputationÂ andÂ researchÂ environment with first class facilities.\r\n Reading through myÂ desired course page, the teaching and assessment patternÂ is very flexible and not too tedious which gives times to students to participate in other activities of their choice isÂ captivating. I know thatÂ university of medical sciences cal is the best choice for me considering the environment, reputable research history, well equipped scienceÂ laboratoryÂ with standard instrumentation,Â and a goodÂ student support system.\r\nThe academic reputation ofÂ the institution attracts me andÂ I am willing to experience and be a part of this great reputable institution,Â I amÂ convincedÂ that itÂ will beÂ a very interesting and stimulating environment to studyÂ coupled withÂ theÂ internationalÂ recognized supervisor to support a high quality research and students experience.\r\nÂ IÂ believe that studying atÂ unimed would helpÂ me develop the knowledge and skills neededÂ for myÂ career path.\r\n I am interested in a master study in Public Health because I want to gain deeper insight into the health behaviors of people, and how to support policies and campaigns that provide easy healthcare access.\r\nI look forward to gaining more knowledge that will aid me to improve on my approach to health issues while initiating campaigns that will help promote the knowledge of basic healthcare and avert preventable health concerns. \r\nI believe the course will be able to provide an opportunity to obtain a more in-depth knowledge within these areas, but also developing a strong theoretical understanding of health policy, epidemiology and research methods, which will give me the underlining knowledge to undertake a phD in public health in the future.\r\nI aim to perform research to evaluate and improve the effectiveness and accessibility of health services for chronic conditions.\r\n\r\nI strongly feel that my undergraduate degree in biochemistry has given me a firm and solid foundation in pursuing a graduate degree in public health and health promotion .Â I had a six-month industrial training program in my third year at a pharmaceutical research and development institute in Nigeria. I was privileged to work at the diagnostic unit of these institute, working with different laboratory scientists and researchers also broaden my knowledge on the analysis of biochemical samples, instrumentation, techniques, and interpretation of parameters and results. This experience was helpful because not only did it strengthened my knowledge and understand of the clinical aspect of biochemistry, but also it improved my ability to cooperate and communicate effectively. I quickly realized that I would like to have a positive impact in the health care system.\r\nÂ Furthermore during my national youth service camping exercise I was a member of the Red Cross society helping to administer first aid to other corp member that are injured during training. I enjoyed being part of the society cause this experience gave me the opportunity to learn how to also care for the sick and needy and how to communicate properly with patients before or during treatment.\r\nI hope to take advantage of the university of medical sciences research facilities and academic support services to help me broaden my knowledge, and also to prepare me for my career.\r\nIn the nearest future, I see myself as a Public Health Practitioner partnering with other skilled professionals to provide healthcare to people of all ages.', '2022-10-31'),
