(1093, 'SPGS74732', 'OGUNLANA GBENGA HOPE', '42027127JC', 'JUNE 2004', 'NATIONAL EXAMINATION COUNCIL', 'English Language|C6', 'Mathematics|C5', 'Biology|C6', 'Chemistry|C6', 'Physics|D7', '|', '|', '|', '|', 'OGUNLANA GBENGA HOPE', '4140116036', 'JUNE 2004', 'WEST AFRICAN EXAMINATION COUNCIL', 'Physics|C6', 'Chemistry|C6', 'Geography|C6', '|', '|', '|', '|', '|', '|', 'SPGS74732olevel1.jpg', 'SPGS74732olevel2.jpg', 'OGUNLANA GBENGA HOPE', 'B.Sc', '0602152', 'Third Class', 'EKITI STATE UNIVERSITY, ADO', '4 YEARS', 'BIOCHEMISTRY', '', '', '', '', '', '', '', 'SPGS74732cert1.jpg', '', '2012 TO 2013', 'OD/ADO/2012/124627', 'SPGS74732nysc.jpg', '', '2023-07-15'),
(1094, 'SPGS13059', 'Babatunde Margaret F', '60403685HH', 'June 2016', 'National Examination Council (NECO) ', 'English Language|C4', 'Mathematics|C4', 'Biology|C4', 'Chemistry|C6', 'Physics|C4', 'Geography|C4', 'Civic Education|C5', 'Yoruba Language|C5', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'olevel1.jpg', '', 'Babatunde Margaret Folasade', 'B.Sc.(Education)', 'ISC/17/6011', 'Upper Credit', 'Adeyemi College of Education(in Affiliation with Obafemi Awolowo University) Ondo', '3 Years', 'Integrated Science/Mathematics', 'Babatunde Margaret Folasade', 'NCE', '1244044', 'Credit', 'Federal College of Education (Special), Oyo', '3 Years', 'Special Education/Integrated Science', 'cert1.jpg', 'cert2.jpg', '2022', 'ED/IFE/2022/036755', 'nysc.jpg', 'I am a beneficiary of Teachings fellow at Adeyemi College of Education (in affiliation with Obafemi Awolowo University), Ondo. The fellowship was as a result of my brilliant academic performance and commitment. I believe this academic pursuit will provide me with more knowledge and guidance in carrying out scientific research, mostly in the field of Mathematical Biology, and help me to contribute both scientifically and academically to some of the problems facing humanity and Africa as a continent.', '2023-07-17'),
(1101, 'SPGS11503', 'Anadu Victor Ebube', '4251726029', 'June 2015', 'West African Senior School Certificate Examination', 'English Language|B3', 'Mathematics|B3', 'Biology|B3', 'Chemistry|C6', 'Physics|C4', '|', '|', '|', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS11503olevel1.jpg', '', 'Anadu Victor Ebube', 'B.Sc', '2016704024', 'Second class, Upper Division', 'Nnamdi Azikiwe University, Awka', '4 years', 'Anatomy', '', '', '', '', '', '', '', 'SPGS11503cert1.jpg', '', '2023', 'OD/22B/0171', 'SPGS11503nysc.jpg', 'My first research was not neuroscience-based but ultimately led to my pursuit of a career in neuroscience. In the final year of my undergraduate studies, I conducted research that evaluated quinine-induced testicular perturbations in a rat model. My primary objective was to determine if an antioxidant could mitigate the toxic effect of quinine. However, outside the scope of my objective, I distinctly observed peculiar behavioural changes in rats exposed to quinine. This particular observation sent me down the path of neuroscience research. I began to read articles that discussed the behavioural implications of neurotoxicants in behaviour. These papers had delineated, to a certain extent, the structural perturbation underlying environment-induced modifications to behaviour. However, there were still lots of unanswered questions and also neuroscience theories that I had not fully conceptualized. Thus, an opportunity to undergo broad training in neuroscience will make up for my current knowledge gap and contribute to my long-term career goal of a neuroscience research career. The MSc Anatomy program, specifically the Neuroscience and Endocrinology division, offered at the University of Medical Sciences is perfect for attaining my aforementioned goal.\r\n\r\nTogether with my academic training in Anatomy, my research experience positions me as the best pick for the MSc Anatomy course. I interned at the Neuro-lab, the Federal University of Technology Akure (Now, Laboratory for Experimental and Translational Neurobiology- LETNeu, UNIMED) for a year; July 2022 â€“ May 2023. During the internship, I was part of a team headed by Dr OM Ijomone and comprised of lab members as well as other collaborators from several institutions. The specific project I undertook examined the effect of stress co-exposure to Nickel and Manganese on certain immunomarkers (GFAP, Iba1, Bcl2, Olig2, Casp3, Bax, and MBP) across various brain regions (hippocampus, thalamus, striatum, cortex, cerebellum and amygdala) as well as evaluate the behavioural implications.  I have continued to expand my research exposure and refine my research interest as a Research Assistant at LETNeu, which is situated at UNIMED. \r\n\r\nThe Anatomy M.Sc program at the University of Medical Sciences has renowned faculty with established neuroscience research. Thus, I am confident that graduate study with these faculty is key for me to develop relevant knowledge and skills to conduct future neuroscience research.\r\n', '2023-07-18'),
