(1264, 'SPGS41239', 'AIYEPE SEKINAT BOLANLE', '24279034', 'JUNE 1996', 'SSCE', 'English Language|B3', 'Mathematics|B3', 'Biology|B3', 'Chemistry|AR', 'Physics|C6', 'Further Mathematics|C6', 'Geography|B3', 'Yoruba Language|A1', 'Food and Nutrition|B3', 'AIYEPE SEKINAT BOLANLE', '55890186', 'DECEMBER 1995', 'GCE', 'Yoruba Language|B3', 'Chemistry|C6', 'Mathematics|C5', 'English Language|C6', 'Biology|E8', 'Economics|C4', 'Physics|D7', 'Geography|C5', 'Further Mathematics|E8', 'olevel1.jpg', 'olevel2.jpg', 'AIYEPE, SEKINAT BOLANLE', 'MBBS', '92459', 'UNCLASSIFIED', 'UNIVERSITY OF IBADAN', 'SEVEN YEARS', 'MEDICINE AND SURGERY', 'BOLA-OYEBAMIJI, SEKINAH BOLANLE', 'FWACS', '5057/OG/NG/15', 'UNCLASSIFIED', 'WEST AFRICAN COLLEGE OF SURGEONS', '6 YEARS', 'OBSTETRICS AND GYNAECOLOGY', 'cert1.jpg', 'cert2.jpg', '2007/2008', 'A001124971', 'nysc.jpg', 'Personal statement in support of the Application for PhD Programme In Surgical Sciences, University of Medical Sciences, Ondo City.  \r\nI graduated from the University of Ibadan, Ibadan, Nigeria, with Bachelor of Medicine and surgery (MB; BS) in July 2005, with a distinction in Physiology. I subsequently had my postgraduate training in the Faculty of Obstetrics and Gynaecology thereby earning a fellowship of the West African College of Surgeons (FWACS) within record time in 2015, and fellowship of the National Postgraduate Medical College of Nigeria (FMCOG), of the same faculty in 2018. I obtained the Membership of the Royal College of Obstetricians and Gynaecologist (MRCOG) in July 2023.\r\nI proceeded for further training in basic and advanced Ultrasound scan in 2015. In further pursuance of more academic and clinical skills, I have undergone training in Cervical cancer prevention and Colposcopy at the Gynaecologic Oncology unit of the Obstetrics and Gynaecology Department of Obafemi Awolowo University Teaching Hospital, Ile-Ife. \r\nI have also undergone online courses of the University of Washington which include Certificate in Leadership in Health Management course in 2020 and Project Management in September 2021. \r\nI am currently a Lecturer/Honorary Consultant at the Obstetrics and Gynaecology department of Osun State University and the affiliated Teaching Hospital, I run the Gynaecologic Oncology Unit where I train resident doctors, house officers as well as medical students. My primary area of interests is in women health. \r\nI have publications in peer reviewed local and international journals in these areas. I have attended various Local and International conferences and presented at many including the Royal college of Obstetrician and Gynaecology World Congress in London in 2019 where I presented an abstract titled â€œSerum ferritin levels in non-anaemic pregnant women on iron supplements; a randomized control trial.â€ \r\n I have organized cervical screening and treatment outreaches in communities within my state of residence. Medical management of cancers of the genital tract must however be driven by Research and consequently evidence-based interventions. Hence my collaborative efforts with African Research group of Oncology which is affiliated to the Memorial Sloan Kettering Cancer Centreâ€™s Global Cancer Disparity initiative. Therefore, I intend to develop and pursue research ideas in gynaecologic oncology which can provide evidence for care of women with cancers of the genital tract in our immediate environment and beyond. \r\nI believe this course will enrich my research skills thereby promoting my academic career. This opportunity if I am given will improve the qualitative research standing of our department and Institution as well as better equip me to carry out my role as a teacher to medical students and supervisor to doctors in residency training and other postgraduate students who are under my supervision. \r\n  \r\n \r\n\r\n\r\n', '2023-08-15'),
