ervices-in-traditional-birth-attendants-tbas-in-rural-community-of-nigeria/\r\n\r\nConferences and Workshops Attended\r\nâ€¢	20th European Meeting on HIV and Hepatitis; European Accreditation Council for Continuing Medical Education (EACCME), held in Paris, France, 08-10 June 2022\r\nâ€¢	Reflections on the COVID-19 pandemic and its application to the HIV response in West and Central Africa; IAS Educational Fund and APIN Public Health Initiatives Virtual Symposium (01-02 June 2022) \r\nâ€¢	International Network on Health and Hepatitis in Substance Users (INHSU) Conference (Novotel Manly, Sydney, Australia + Virtual Conference) from13-15th October 2021\r\nâ€¢	4th HIV Research for Prevention Conference (HIVR4P//Virtual) held in Cape Town, South Africa between 27 & 28 Jan 3 & 4 Feb. 2021\r\nâ€¢	Delegate at 23rd International AIDS Conference (#AIDS2020Virtual) held in San Francisco and Oakland, United States of America between 6th-11th July 2020\r\nâ€¢	Delegate at 22nd International AIDS Conference held at RAI Amsterdam, The Netherlands on the 23rd-27th July 2018\r\nâ€¢	Biomedical Research Innovations in the Prevention, Remission and Cure of HIV/AIDS, held on Monday 23rd July 2018 at Elicium 2 RAI, Amsterdam, The Netherlands.\r\nâ€¢	Resource Mobilization for Gender Programming by Balm in Gilead Foundation for Sustainable Development (BIGIF) held at Ado Ekiti on the 14th-16th June 2018\r\nâ€¢	Drug Policy Academy by YouthRISE Nigeria and International Drug Policy Consortium held at Abuja, Nigeria on the 21st-23rd May 2018\r\nâ€¢	Gender Based Violence Case Management and Reporting supported by Balm in Gilead Foundation for Sustainable Development (BIGIF) funded by Kingdom of Netherlands, 11th-13th December 2017\r\nâ€¢	Young African Leaders Initiative (YALI) West African Regional program, Nigeria cohort 3 at Administrative Staff College of Nigeria (ASCON) in collaboration with YALI Regional Leadership Center (RLC), held in Badagry, Lagos, Nigeria between September-October 2017\r\nâ€¢	Minimum Prevention Package of Intervention (MPPI) & District Health Information System (DHIS) 2.0 training by National AIDS Control Agency for the Control of AIDS (NACA) and Ekiti State AIDS Control Agency (EKSACA)\r\nâ€¢	Capacity Building and System Strengthening for CSOs working on HIV/AIDS in Ekiti State Nigeria by the African Regional Health Education Center and University of Ibadan\r\nâ€¢	After completing the \"e-Learning Course on Management in Health (Cohort 1) FY 16\" I received a certificate from The World Bank Group 2015\r\n\r\nArticle publications\r\nâ€¢	http://nhvmas-ng.org/site/domestic-resource-mobilization-critical-for-changing-the-narrative-of-the-hiv-prevention-and-treatment-response-in-nigeria-kayode-owoso/\r\nâ€¢	http://nhvmas-ng.org/site/capacity-building-for-tbas-a-critical-component-to-eliminate-mother-to-child-transmission-of-hiv-kayode-owoso/\r\nâ€¢	https://nhvmas-ng.org/site/hiv-is-preventable-within-72-hours-of-exposure-owoso-kayode-teslim/\r\nâ€¢	https://nhvmas-ng.org/site/stay-safe-use-a-rubber-owoso-kayode-teslim/\r\nâ€¢	https://nhvmas-ng.org/site/accine-is-one-of-the-best-scientific-ways-to-end-hiv-epidemic/\r\n\r\nAssociations\r\nâ€¢	Member: International AIDS Society (IAS)\r\nâ€¢	Member: Society for AIDS in Africa (SAA)'),
