('SPGS13059', 'Babatunde', 'Margaret Folasade', 'Female', '6/24/1995', 'Single', 'NIGERIAN', 'OYO', 'Iwajowa', 'margaretbabatunde2017@gmail.com', '8105954286', 'Igbeyinadun street, off Adeyemi College of Education, Ondo', 'SPGS13059.jpg', 'Sciences', 'Mathematics(Mathematical Biology)', 'Masters', 'MSc', 'Babatunde ', 'Florence Temitayo', '9064577455', 'babatundeflorence5@gmail.com', 'Babatunde Margaret F', '60403685HH', 'Jun-16', 'National Examination Council (NECO) ', 'English Language|C4', 'Mathematics|C4', 'Biology|C4', 'Chemistry|C6', 'Physics|C4', 'Geography|C4', 'Civic Education|C5', 'Yoruba Language|C5', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'olevel1.jpg', '', 'Babatunde Margaret Folasade', 'B.Sc.(Education)', 'ISC/17/6011', 'Upper Credit', 'Adeyemi College of Education(in Affiliation with Obafemi Awolowo University) Ondo', '3 Years', 'Integrated Science/Mathematics', 'Babatunde Margaret Folasade', 'NCE', '1244044', 'Credit', 'Federal College of Education (Special), Oyo', '3 Years', 'Special Education/Integrated Science', 'cert1.jpg', 'cert2.jpg', '2022', 'ED/IFE/2022/036755', 'nysc.jpg', 'I am a beneficiary of Teachings fellow at Adeyemi College of Education (in affiliation with Obafemi Awolowo University), Ondo. The fellowship was as a result of my brilliant academic performance and commitment. I believe this academic pursuit will provide me with more knowledge and guidance in carrying out scientific research, mostly in the field of Mathematical Biology, and help me to contribute both scientifically and academically to some of the problems facing humanity and Africa as a continent.'),
('SPGS30843', 'YUSUF', 'GANA SAMUEL', 'Male', '7/6/1967', 'Married', 'NIGERIAN', 'KWARA', 'Pategi', 'yusuf4samuel@gmail.com', '8038607137', 'KWARA STATE COLLEGE OF HEALTH TECHNOLOGY, OFFA', 'SPGS30843.jpg', 'Public Health', 'Community Health ', 'Doctorate', 'PhD', 'GANA', 'SUZANA SAMUEL', '8030737429', 'suzanasamu234@gmail.com', 'YUSUF GANA SAMUEL', '50695678EC', 'JUN/JUL 2015', 'NECO', 'English Language|C5', 'Mathematics|C6', 'Biology|C6', 'Chemistry|C6', 'Physics|D7', 'Civic Education|C5', 'Agricultural Science|C5', 'Christian Religious Knowledge|C5', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS30843olevel1.jpg', '', 'YUSUF GANA SAMUEL', 'B.Sc (Ed)', '10/67QP042', 'Second Class, Lower Division', 'University of Ilorin, Kwara State', '5 Years', 'Health Education', 'YUSUF SAMUEL GANA', 'MPH', 'EAA1500334', 'PASS', 'Ladoke Akintola University of Technology, Ogbomoso, Nigeria ', '2 Year', 'Environmental Health Management ', 'SPGS30843cert1.jpg', 'SPGS30843cert2.jpg', '2015', 'P/EXC/01380194', 'SPGS30843nysc.jpg', ''),
('SPGS11503', 'Anadu', 'Victor Ebube ', 'Male', '8/22/1999', 'Single', 'NIGERIAN', 'ANAMBRA', 'Nnewi North', 've.anadu@gmail.com', '8030958471', 'Ogedengbe Street, Laje road, Ondo state', 'SPGS11503.jpg', 'Basic Medical Sciences', 'Anatomy', 'Masters', 'MSc', 'Anadu', 'Uzoma Christiana', '7033679454', 'uzomaanadu1@gmail.com', 'Anadu Victor Ebube', '4251726029', 'Jun-15', 'West African Senior School Certificate Examination', 'English Language|B3', 'Mathematics|B3', 'Biology|B3', 'Chemistry|C6', 'Physics|C4', '|', '|', '|', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS11503olevel1.jpg', '', 'Anadu Victor Ebube', 'B.Sc', '2016704024', 'Second class, Upper Division', 'Nnamdi Azikiwe University, Awka', '4 years', 'Anatomy', '', '', '', '', '', '', '', 'SPGS11503cert1.jpg', '', '2023', 'OD/22B/0171', 'SPGS11503nysc.jpg', 'My first research was not neuroscience-based but ultimately led to my pursuit of a career in neuroscience. In the final year of my undergraduate studies, I conducted research that evaluated quinine-induced testicular perturbations in a rat model. My primary objective was to determine if an antioxidant could mitigate the toxic effect of quinine. However, outside the scope of my objective, I distinctly observed peculiar behavioural changes in rats exposed to quinine. This particular observation sent me down the path of neuroscience research. I began to read articles that discussed the behavioural implications of neurotoxicants in behaviour. These papers had delineated, to a certain extent, the structural perturbation underlying environment-induced modifications to behaviour. However, there were still lots of unanswered questions and also neuroscience theories that I had not fully conceptualized. Thus, an opportunity to undergo broad training in neuroscience will make up for my current knowledge gap and contribute to my long-term career goal of a neuroscience research career. The MSc Anatomy program, specifically the Neuroscience and Endocrinology division, offered at the University of Medical Sciences is perfect for attaining my aforementioned goal.\r\n\r\nTogether with my academic training in Anatomy, my research experience positions me as the best pick for the MSc Anatomy course. I interned at the Neuro-lab, the Federal University of Technology Akure (Now, Laboratory for Experimental and Translational Neurobiology- LETNeu, UNIMED) for a year; July 2022 â€“ May 2023. During the internship, I was part of a team headed by Dr OM Ijomone and comprised of lab members as well as other collaborators from several institutions. The specific project I undertook examined the effect of stress co-exposure to Nickel and Manganese on certain immunomarkers (GFAP, Iba1, Bcl2, Olig2, Casp3, Bax, and MBP) across various brain regions (hippocampus, thalamus, striatum, cortex, cerebellum and amygdala) as well as evaluate the behavioural implications.  I have continued to expand my research exposure and refine my research interest as a Research Assistant at LETNeu, which is situated at UNIMED. \r\n\r\nThe Anatomy M.Sc program at the University of Medical Sciences has renowned faculty with established neuroscience research. Thus, I am confident that graduate study with these faculty is key for me to develop relevant knowledge and skills to conduct future neuroscience research.\r\n'),
