('SPGS81598', 'Ugwuibe', 'Obianuju', 'Female', '2/17/1986', 'Married', 'NIGERIAN', 'IMO', 'Ahiazu-Mbaise', 'ujugwuibe@gmail.com', '8037056450', '13 Abioro Street, Ikate, Lekki', 'SPGS81598.jpg', 'Institute of Advanced Clinical Sciences Education ', 'Institute of Advanced Clinical Sciences Education (Health Law and Policy)', 'Masters', 'MSc', 'Ugwuibe', 'Chibuike', '8135551365', 'obikaraugwuibe@gmail.com', 'Ugwuibe Obianuju', '4111725014', 'Jun-00', 'WASSCE', 'English Language|C6', 'Mathematics|B3', 'Biology|C4', 'Chemistry|B2', 'Physics|C6', 'Economics|C4', 'Agricultural Science|B3', '|', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS81598olevel1.jpg', '', 'Ugwuibe Obianuju', 'MBChB', 'CLI/2007/290', 'Nil', 'Obafemi Awolowo University, Ile-Ife', '5years', 'Medicine and Surgery', 'Ugwuibe ObianuJu', 'B.Sc', 'U2001/4792367', 'Second Class', 'University Of PortHarcourt', '4years', 'Human Anatomy', 'SPGS81598cert1.jpg', 'SPGS81598cert2.jpg', '2007', 'RV/UPP/07/396288', 'SPGS81598nysc.jpg', ''),
('SPGS21034', 'Anyakee', 'Chinenye Tina', 'Female', '11/2/1989', 'Single', 'NIGERIAN', 'ANAMBRA', 'Nnewi South', 'anyakeect@yahoo.com', '8066154670', '4, Albert Lane, Akure, Ondo State', 'SPGS21034.jpg', 'Public Health', 'Public Health', 'Doctorate', 'PhD', 'Anyakee', 'Onyinye Prisca', '7039688720', 'anyakeeop@gmail.com', 'Anyakee Chinenye Tina', '4290610084', 'Jun-06', 'WAEC', 'English Language|C4', 'Mathematics|C6', 'Biology|B3', 'Chemistry|C5', 'Physics|C4', 'Economics|C5', 'Geography|B3', 'Agricultural Science|B3', '|', '', '', '', '', '|', '|', '|', '|', '|', '|', '|', '|', '|', 'SPGS21034olevel1.jpg', '', 'Chinenye Tina Anyakee', 'B.Sc', 'FNC/2007/036', 'Second Class (Lower Division)', 'Obafemi Awolowo University', '4 years', 'Foods, Nutrition & Dietetics', 'Chinenye Tina Anyakee', 'MPH', 'PG/MPH/2015/77951', 'Second Class (Upper Division)', 'University of Nigeria', '2 years', 'Public Health', 'SPGS21034cert1.jpg', 'SPGS21034cert2.jpg', '2013/2014', 'NYSC/EN/IFE/2013/186480', 'SPGS21034nysc.jpg', 'I want to state that I am excited about pursuing a PhD program at the University of Medical Sciences; I, therefore, thank you for taking the time to review my application.\r\n\r\nTina Anyakee is a dedicated public health practitioner and visionary leader, with a deep commitment to revolutionizing healthcare systems and eradicating disease-related disabilities, focusing on the diabetic population. She aspires to advance the field of public health through ground-breaking research and sustainable solutions to the most pressing public health challenges of our time. Through her company - Right Nutrition, she continues to leverage her understanding of behavioural and systemic barriers to adequate healthcare systems, to improve the prevention, treatment and management of diabetes, through strategic collaborations with primary care physicians, medical consultants and hospitals. With a solid background in public health and a wealth of clinical experience across and beyond Nigeria, she is able to bring and uniquely contribute diversity to any academic class. She will undoubtedly be an asset to the PhD Public Health class of 2022/2023.\r\n\r\nDiabetes, a leading cause of adult blindness affects about 422 million persons globally, with Nigeria having the greatest incidence in sub-Saharan Africa. Ineffective healthcare delivery had been reported as one of the drivers of associated mortality. Due to the very low patient-to-diabetes specialist ratio in Nigeria â€“ 1:600,000, the diabetes clinical practice guideline became necessary to guide the primary care physicians who are major providers of diabetes care for the Nigerian diabetic population. Studies have reported the inability of many primary care physicians to offer optimal diabetes care, highlighting the need for referral and a multidisciplinary approach to diabetes care unfortunately; there is a paucity of data on the referral practices of primary care physicians.\r\n\r\nSince the majority of the people living with diabetes in Nigeria are managed by primary care physicians, it becomes important to evaluate their referral practices and how it contributes to the growing diabetes epidemic in Nigeria. From pre-diabetes to diabetes to diabetes-related disability. My PhD research will therefore focus on exploring the impact of primary care physiciansâ€™ referral practices on the clinical outcomes of out-patients living with pre-diabetes, diabetes and diabetes-related disability in Ondo State Nigeria. The research will among other things reveal the percentage of out-patients living with pre-diabetes, diabetes and diabetes-related disability that are referred by primary care physicians; identify specialists that primary care physicians refer out-patients living with pre-diabetes, diabetes and diabetes-related disability to; establish the relationship between primary care physiciansâ€™ referral practices and the onset of diabetes and diabetes-related disability among out-patients living with pre-diabetes; and establish the relationship between primary care physiciansâ€™ referral practices and out-patients living with pre-diabetes, diabetes and diabetes-related disabilityâ€™s compliance with non-pharmacological treatment regimen. Out-patients who fall within the criteria but were born with a disability will be excluded from the study.\r\n\r\nThe research will especially help me to establish a nexus for my observations at the clinical level, sharpening my ability to develop context-specific strategies for the efficient management of pre-diabetes and diabetes.\r\n\r\nThank you.\r\n\r\nTina Anyakee\r\n'),
