('SPGS15299', 'ALADEMEHIN', 'AYOMIKUN PETER ', 'Male', '6/7/1997', 'Single', 'NIGERIAN', 'ONDO', 'Okitipupa', 'petercolialademehin@gmail.com', '8160435470', '31, Kalejaye street, Okitipupa', 'SPGS15299.jpg', 'Allied Health Sciences', 'Medical Laboratory Science(Public Health Microbiology)', 'Masters', 'MSc', 'ALADEMEHIN ', 'OLUWASEUN SAMUEL', '8137504959', 'bossaladoluwatimilehin68@gmail.com', 'ALADEMEHIN AYOMIKUN PETER ', '4291432051', 'June, 2013', 'West African Senior School Certificate Examination', 'English Language|C6', 'Mathematics|B3', 'Biology|B3', 'Chemistry|B2', 'Physics|B3', '|', '|', '|', '|', '', '', '', '', 'Agricultural Science|A1', 'Economics|C4', 'Yoruba Language|C4', 'Geography|A1', '|', '|', '|', '|', '|', 'SPGS15299olevel1.jpg', '', 'ALADEMEHIN AYOMIKUN PETER ', 'B.Sc', '14MB1008', 'Second class upper ', 'Kogi State University, Anyigba, Kogi State.', '4 Years ', 'Microbiology ', '', '', '', '', '', '', '', 'SPGS15299cert1.jpg', '', '2018/2019', 'SO/KUY/2018/223909', 'SPGS15299nysc.jpg', 'PERSONAL INTENT\r\nThe unabated rise in the incidence and mortality rates recorded in developing countries due to preventable diseases (such as malaria, HIV/AIDS, tuberculosis and other infections and non- communicable diseases) and inadequate skilled diagnostician is what has become my primary motivation to pursue a career in Public Health (Global Health) to acquire skills and profound knowledge of public health practices, and its applications in community disease control and health improvement, needed to improve preventive and curative care of the general population in low resource areas. As a trained and certified microbiologist who is keenly interested in ensuring that the Sustainable Development Goal 3 is accomplished, I am naturally attracted to a career that have the tendency to develop my ability to strategize and implement effective health improvement program and also advance healthcare delivery in Nigerian communities. Consequently, I chose this career path believing it will inculcate me with the understanding of the strategies involved in planning and effectively implementing public health program and projects in communities. \r\nThrough this program, I expect to learn cutting edge molecular diagnostic techniques, develop my knowledge of maternal and child health, global non-communicable diseases such as cancer, cardiovascular diseases and improve my understanding of global/public health policies and their influence on health development. I also hope to be inculcated  with the knowledge of the pathogenesis of infectious and non  infectious diseases, how to formulate research problems in statistical terms and how to design informative experiment by applying appropriate statistical method to investigate the epidemiology of diseases. I find these pertinent to my career vision and thus, have chosen this path.'),
