('SPGS17189', 'OLANREWAJU', 'FATAI OLATUNDE', 'Male', '12/31/1972', 'Married', 'NIGERIAN', 'ONDO', 'Ile-Oluji - Oke Igbo', 'docjufat@yahoo.com', '8035765004', 'Plot 3 & 19 Junior Staff Quarter, Ijebu-Owo, Owo, Ondo State', 'SPGS17189.jpg', 'Institute of Advanced Clinical Sciences Education ', 'Institute of Advanced Clinical Sciences Education(Medical Sciences)', 'Doctorate', 'PhD', 'OLANREWAJU', 'OLUWASADE FLORENCE', '8036206823', 'docjufat99@gmail.com', 'OLANREWAJU FATAI', '27217030', 'Jun-93', 'WAEC/SSCE', 'English Language|C6', 'Mathematics|D7', 'Biology|B3', 'Chemistry|B2', 'Physics|B2', '|', '|', '|', '|', 'OLANREWAJU FATAI', '18224067', 'Dec-90', 'WAEC/SSCE', 'Agricultural Science|C6', 'Mathematics|C6', 'Biology|D7', 'Chemistry|D7', 'Physics|C4', '|', '|', '|', '|', 'SPGS17189olevel1.jpg', 'SPGS17189olevel2.jpg', 'OLANREWAJU FATAI OLATUNDE', 'M.B.B.S.', '93/3079', 'PASS', 'UNIVERSITY OF MAIDUGURI', '6 YEARS', 'MEDICINE AND SURGERY', 'OLANREWAJU FATAI OLATUNDE', 'FMCP (DERMATOLOGY)', '', 'PASS', 'NATIONAL POSTGRADUATE MEDICAL COLLEGE OF NIGERIA', '6 YEARS', 'DERMATOLOGY/VENEREOLOGY', 'SPGS17189cert1.jpg', 'SPGS17189cert2.jpg', 'Mar-04', 'PL/UMH/03/104058', 'SPGS17189nysc.jpg', 'Department of Dermatology/Venereology,\r\nFaculty of Clinical Sciences,\r\nCollege of Health Sciences,\r\nObafemi Awolowo University\r\nIle-Ife, Osun State.\r\nSeptember 19th, 2023.\r\n\r\nThe Dean,\r\nPostgraduate School,\r\nUniversity of Medical Sciences,\r\nOndo City, Ondo state.\r\nINTENT TO JOIN THE PhD PROGRAMME IN MEDICAL SCIENCES\r\nI write to express my deep intention to join the PhD programme in Medical Sciences of your reputable University of Medical Sciences which was advertised at the university website recently. As a leading and first ever university of medical sciences I believe is a perfect place to pursue my academic progression.\r\nI obtained my Bachelor of Medicine and Bachelor of Surgery from the University of Maiduguri, Maiduguri, Borno State in August, 2001. I later proceeded for a Residency training in 2008 at the Obafemi Awolowo University Teaching Hospitals Complex, Ile-Ife to pursue a career in Internal Medicine (Dermatology and Venereology Subspecialty) which I successfully completed in 2015. In a bid to fulfil my long time ambition to acquiring more knowledge in Dermatology and venereology and to impact knowledge in younger colleagues, I joined the services of Obafemi Awolowo University as Lecturer I and at present a Senior Lecturer in the Department of Dermatology/Venereology.\r\nI have also been involved in many research output, training of many undergraduate and supervision of postgraduate students in the university.\r\nMy research interest is focused on Dermatology and Venereology (Sexually Transmitted Diseases). I have about thirty (30) publications to my credit in reputable journals.\r\nIt will be a great joy if my application is given a favourable consideration. I will be willing to give any further information as may be require by the university.\r\nThanks for your time and anticipated consideration.\r\nYours sincerely,\r\n\r\nOLANREWAJU Fatai Olatunde (MBBS, FMCP)\r\nE-mail: docjufat@yahoo.com/08035765004\r\n'),
