(1, 'SPGS25643', '1-5 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'The candidate has the requisite qualification and motivation to pursue the DrPH programme. I know him socially and I have also mentored his previous postgraduate work. I strongly recommend him', 'folu_owotade@yahoo.com', '2022-02-16'),
(19, 'SPGS78661', '1-5 Years', 'Supervisor', 'Medium', 'Medium', 'High', 'Medium', 'Mr Olagunju is well known to me as a very responsible young man with unusual passion for knowledge and excellence in whatever he does.\r\nHe is very brilliant and dedicated to his assignments ', 'yemiandyemi@yahoo.com', '2022-03-14'),
(18, 'SPGS32014', 'More than 10 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'I highly recommend Dr. Segun Adeoye.  He will definitely benefit from the PhD program and will make great contributions while also being a valuable and resourceful asset to the University.', 'fakala@worldbank.org', '2022-03-11'),
(4, 'SPGS54079', 'More than 10 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'She is pleasant, forthright, loyal and hardworking officer. \r\nShe is a diligent officer ready to take up additional responsibilities ', 'adijiayo@yahoo.com', '2022-02-22'),
(5, 'SPGS90004', 'More than 10 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'She is a dedicated physician with an untiring desire to always improve her clinical research knowledge, skills and capacity. ', 'linkseunawe@gmail.com', '2022-02-23'),
(6, 'SPGS18654', '5-10 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'She is a hardworking, dutiful, good team player, intelligent and result-oriented young lady. She is always willing to learn and a committed individual. I, therefore strongly recommend her. ', 'yetundeolagbuji@gmail.com', '2022-02-25'),
(7, 'SPGS62088', 'More than 10 Years', 'Others', 'High', 'High', 'High', 'High', 'He is affable to all a sundry , responsible, respected and accord all people he comes close with. Learning new things, is the hall mark. Always wants to add to already existing knowledge to expand the sphere of knowledge ', 'BB4STEPOBBB@YAHOO.COM', '2022-03-01'),
(8, 'SPGS96480', '1-5 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'He is simple minded and always enthusiastic in accomplishing in grand style whatever he set his mind at.', 'ucheodioneynma@yahoo.com', '2022-03-04'),
(9, 'SPGS87260', '1-5 Years', 'Co-Staff', 'High', 'High', 'High', 'High', 'Good and hardworking staff\r\nInnovative and ready to undertake any task assigned', 'okyerekwaku85@yahoo.com', '2022-03-04'),
(10, 'SPGS87260', '5-10 Years', 'Others', 'High', 'High', 'High', 'High', 'He can function in well in various task assigned\r\nHe is also a team player and reason deep when it comes to situations at hand\r\nI highly recommend him for this course', 'lindakumi89@yahoo.com', '2022-03-04'),
(11, 'SPGS11784', '5-10 Years', 'Lecturer/Teacher', 'High', 'High', 'High', 'High', 'Intelligent med lab scientist\r\nIndustrious and reliable', 'lekanadebimpe@unimed.edu.ng', '2022-03-05'),
(12, 'SPGS17419', 'More than 10 Years', 'Others', 'High', 'High', 'High', 'High', 'The candidate is quiet, focused, hardworking and always eager to learn under any condition. She is a fast learner and has the mental capability to cope with her course of choice. ', 'tope222@yahoo.com', '2022-03-05'),
(13, 'SPGS62895', 'More than 10 Years', 'Others', 'High', 'High', 'High', 'High', 'A brilliant, smart, intelligent and outstanding. A perfectionist who delivers any task given to her promptly. A verse reservoir in the nursing profession with more than two decades of professional experience.', 'erictaiwoa@yahoo.com', '2022-03-05'),
(14, 'SPGS21387', '5-10 Years', 'Others', 'High', 'High', 'High', 'High', 'The candidate Mr Arowolo is highly recommended for the course. Thanks', 'dorcasjohn@yahoo.com', '2022-03-07'),
(15, 'SPGS97614', '5-10 Years', 'Co-Staff', 'High', 'High', 'High', 'High', 'Mrs. Olusola-Makinde is a self-motivated and goal-driven young lady who is dedicated to her work. She is brilliant, versatile and possesses a high level of intellectual openness, creativity and scientific curiosity. She is rugged, thorough, and highly dependable with admirable character\r\n', 'osmakinde@futa.edu.ng', '2022-03-07'),
