(17, 'SPGS32014', '1-5 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'I have rated Dr. Adeoye Olusegun high in all parametres because it is the reality of the character he exhibits plus more excellent qualities. \r\n\r\nHowever, as we are aware that no one is perfect though, including himself but he gives room for him to be corrected as well as act as being corrected. \r\n', 'tadesina@prj.wahooas.org', '2022-03-10'),
