(29, 'SPGS16021', '1-5 Years', 'Co-Staff', 'High', 'High', 'High', 'High', 'Very intelligent, hardworking and determined.', 'tongjoshy@gmail.com', '2022-03-26'),
(30, 'SPGS13205', '5-10 Years', 'Lecturer/Teacher', 'High', 'High', 'High', 'High', 'Miss Eyerue OVHARHE is a hard working scholar, competent in her field and with high altitude to undergo an independent research. I strongly recommend her', 'augustine.aikoriogie@uniben.edu', '2022-03-28'),
(31, 'SPGS57465', '1-5 Years', 'Supervisor', 'High', 'High', 'High', 'High', 'A responsible and diligent woman, with focus on achieving her set objectives.', 'ooosunmak@yahoo.com', '2022-03-28'),
(32, 'SPGS93312', 'More than 10 Years', 'Lecturer/Teacher', 'High', 'High', 'High', 'High', 'He shows high disposition to research and academics. He is matured and relates well with his superiors and colleagues.', 'moonstapha@yahoo.com', '2022-03-30'),
(33, 'SPGS20993', '1-5 Years', 'Lecturer/Teacher', 'High', 'High', 'High', 'High', 'He is one of the best students in his class. He is above average and will do well if given admission ', 'Bomolaso@unimed.edu.ng', '2022-04-01'),
(34, 'SPGS22378', '5-10 Years', 'Others', 'High', 'High', 'Medium', 'Medium', 'He has the ability to conceive and carry out research work with less supervision', 'bomolaso@unimed.edu.ng', '2022-04-01'),
(35, 'SPGS20993', '5-10 Years', 'Others', 'High', 'High', 'High', 'High', 'I have known Ogunmiluyi for about 6 years when I taught him during his undergraduate days in Physiology Department UNIMED. He was one of the best graduating students in his set. I have no doubt that he will be able to cope in his postgraduate studies. So I strongly recommend him for the program.', 'aakinola@unimed.edu.ng', '2022-04-03'),
(36, 'SPGS93312', '1-5 Years', 'Supervisor', 'High', 'High', 'High', 'Medium', 'Kazeem is a hardworking, committed and intelligent student whom I supervised in his MSc project. I will without reservation accept him as my PHD student.', 'rnwuba@unimed.edu.ng', '2022-04-03'),
